import React from "react"
import ReactDOMClient from "react-dom/client"

function setInfo() {

}

function ChInfo() {
    return (
        <div id="userFullInfo">
            <div id="inf">
                <p>Новые данные</p>
                <div id="chpass">
                    <p>Новый мобильный</p><input type="password" name="newpass1" placeholder="Новый пароль" id="newpass1" />
                    <p>Новый E-mail</p><input type="password" name="newpass2" placeholder="Повтор нового пароля" id="newpass2" />
                    <button onClick={setInfo} id="chpassb">Изменить</button>
                    <a id="messchpass" style={{ display: "none" }} href="/">Пароль успешно изменен, перейти в ЛК</a>
                </div>
            </div>
        </div>
    )
}

export function chInfo() {
    const fullinfo = ReactDOMClient.createRoot(document.getElementById("userFullInfo"));
    fullinfo.render(<ChInfo />);
}
